import axios from 'axios';
import { useEffect } from 'react';
const API_KEY = '43f7b7cce2ae5cabfc5e2f76a4248ec7';

const GalleryHeader = (props) => {
    var request = "";
    useEffect(() => {
        request = "https://api.themoviedb.org/3/genre/movie/list?api_key=" + API_KEY + "&language=en-US";
        axios.get(request)
            .then ((response) => {
                console.log(response);
                props.setGenreList(genreList => [...genreList, response.data]);
            })
            .catch(function(error) {
                console.log(error);
            });
        console.log(props.genreList);
    }, []);

    return (
        <h1>{props.genreList[0]}</h1>
    )
} 
export default GalleryHeader
